import React from "react";
import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          hello
          <br />0
        </div>,
        <div key="following">
          팔로잉
          <br />0
        </div>,
        <div key="follower">
          팔로워
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>Hy</Avatar>} title="Hello" />
      <Button></Button>
    </Card>
  );
};

export default UserProfile;
